public class AppImageConfigFactory(string resourceName = null, Action<Humidifier.SageMaker.AppImageConfig> factoryAction = null) : ResourceFactory<Humidifier.SageMaker.AppImageConfig>(resourceName)
{

    internal InnerAppImageConfigKernelGatewayImageConfigFactory KernelGatewayImageConfigFactory { get; set; }

    internal InnerAppImageConfigCodeEditorAppImageConfigFactory CodeEditorAppImageConfigFactory { get; set; }

    internal InnerAppImageConfigJupyterLabAppImageConfigFactory JupyterLabAppImageConfigFactory { get; set; }

    protected override Humidifier.SageMaker.AppImageConfig Create()
    {
        var appImageConfigResult = CreateAppImageConfig();
        factoryAction?.Invoke(appImageConfigResult);

        return appImageConfigResult;
    }

    private Humidifier.SageMaker.AppImageConfig CreateAppImageConfig()
    {
        var appImageConfigResult = new Humidifier.SageMaker.AppImageConfig
        {
            GivenName = InputResourceName,
        };

        return appImageConfigResult;
    }
    public override void CreateChildren(Humidifier.SageMaker.AppImageConfig result)
    {
        base.CreateChildren(result);

        result.KernelGatewayImageConfig ??= KernelGatewayImageConfigFactory?.Build();
        result.CodeEditorAppImageConfig ??= CodeEditorAppImageConfigFactory?.Build();
        result.JupyterLabAppImageConfig ??= JupyterLabAppImageConfigFactory?.Build();
    }

} // End Of Class

